import logo from './logo.svg';
import './App.css';
import newSimpleForm from './newSimpleForm.js';
import Scores from './score.js'
import Cookie from './cookieButton.js'

function cookieButton() {
  return (
   <button className="cookie" onClick="" />
  )
}
function score() {
   return (
     <input value={score} />
   )
}

function App() {
  return (
    <div>
      <Cookie />
      <cookieButton />
      <score />
    </div>
  );
}

export default App;
